import React from "react";
class ListContact extends React.Component {
  render() {
    return (
      <ol className="contact-list">
        {this.props.contacts.map((contact) => (
          <li key={contact.id}>{this.contact.name}</li>
        ))}
      </ol>
    );
  }
}
export default ListContact;
